import React from "react"

function Video(){
    return (
        <div class="video-wrapper">
        <video playsinline autoplay muted loop poster="images/tiger.png" src="images/Stars.mp4" type="video/mp4">
          <source src="images/calm-bg.mp4" type="video/mp4"></source>
        </video>
        </div>
    )
}

export default Video;
